// Resume.js
import React from 'react';
import resumeData from './resumeData.json';

const Resume = () => {
  const { name, phone, location, email, linkedin, summary, jobs, education, skills, volunteerExperience } = resumeData;

  return (
    <div>
      <h2>{name}</h2>
      <p>{phone} | {location} | {email} | {linkedin}</p>
      <p>{summary}</p>

      <h3>Experience</h3>
      {jobs.map((job, index) => (
        <div key={index}>
          <h4>{job.position} - {job.company} ({job.dates})</h4>
          <ul>
            {job.responsibilities.map((responsibility, idx) => (
              <li key={idx}>{responsibility}</li>
            ))}
          </ul>
        </div>
      ))}

      <h3>Education</h3>
      <p>{education.degree} - {education.institution} ({education.graduationDate})</p>

      <h3>Skills</h3>
      <ul>
        {skills.map((skill, index) => (
          <li key={index}>{skill}</li>
        ))}
      </ul>

      <h3>Volunteer Experience</h3>
      {volunteerExperience.map((exp, index) => (
        <div key={index}>
          <h4>{exp.organization} ({exp.dates})</h4>
          <p>{exp.description}</p>
        </div>
      ))}
    </div>
  );
};

export default Resume;
